import React from 'react';
import { Navigate } from "react-router-dom";

const ProtectedRoute = ( loggedIn ) => {
    return (
      loggedIn ? <Navigate to='/' /> : <Navigate to="/sign-in" replace/>
  )}

  export default ProtectedRoute;
